import logo from "../../images/logo.png";
import {
  BannerWrapper,
  Logo,
  ScrollingText,
  Subtitle,
  Title,
  TitleTrack,
  Wrapper,
} from "./styled";
import bg from "../../images/background.png";

export const Top = () => {
  return (
    <Wrapper bg={bg}>
      <Logo src={logo} />
      <BannerWrapper>
        <TitleTrack>
          <ScrollingText>
            Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦
          </ScrollingText>
          <ScrollingText>
            Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦
          </ScrollingText>
          <ScrollingText>
            Renowacja felg, CNC, Malowanie proszkowe, Piaskowanie ✦
          </ScrollingText>
        </TitleTrack>
      </BannerWrapper>
    </Wrapper>
  );
};
